import React from "react";

class Footer extends React.Component {
  render() {
    return (
      <div className="wrap">
        <div className="bottom">
          <div className="arrow_left"></div>
          <div className="arrow_right"></div>
        </div>
      </div>
    );
  }
}

export default Footer;
